You guys always ask me about my Jade Roller and Gua Sha tools so wanted to make this video to show how I use them in my skincare routine. This is just how I personally use the tools and it works for me. For those beginners out there, here are the basics:⁣
⁣
1. Both the Gua Sha and Jade roller are facial tools to help with lymphatic drainage ( the flushing of toxins and bacteria from your system), removing puffiness, promoting skin elasticity and product penetration. ⁣
2. Both have similar results but the Gua Sha is more for sculpting and the Jade Roller is more for the circulation of fluid. ⁣
3. Make sure the tool you are getting is authentic Jade/Rose Quartz, otherwise it can cause skin irritation.⁣
4. Which one you like is as per your own preference and what works for you and your lifestyle! The Roller is a bit more convenient but the Gua Sha can be great for contouring once you get use to it! ⁣
